import Link from 'next/link'

const Navbar = () => (
    <div>
        <ul>
            <li><Link href="/" title="Home"><a>Home</a></Link></li>
            <li><Link href="/about" title="About"><a>About</a></Link></li>
        </ul>
    {/* <style jsx>{`
